import { Suspense, lazy } from 'react';
import styled from 'styled-components';

const LoadingContainer = styled.div`
  width: 100%;
  height: 90%;
  display: flex;
  align-items: center;
  justify-content: center;
  background: rgba(111, 66, 193, 0.1);
  border-radius: 8px;
  margin-top: -10%;
`;

const AnimationFrame = styled.iframe`
  width: 90%;
  height: 100%;
  border: none;
  position: absolute;
  top: 40%;
  left: 50%;
  transform: translate(-50%, -50%);
  clip-path: inset(0 0 10% 0);
`;

const SplineAnimation = () => {
  return (
    <Suspense fallback={
      <LoadingContainer>
        <div>Loading animation...</div>
      </LoadingContainer>
    }>
      <AnimationFrame 
        src='https://my.spline.design/database-ea358fb31c2823da4f9c6b65d1e92f13/' 
        frameBorder='0'
        title="Database Animation"
        loading="lazy"
      />
    </Suspense>
  );
};

export default SplineAnimation;
